import React from 'react';

const ServicesSection = (dark, id) => {
    return (
        <div className={"section" + (dark ? " section-dark" : "")}>
            <div className="section-content" id={id}>
                <h1>Services</h1>
            </div>
        </div>
    )
};

export default ServicesSection;
